import React, { useState, useEffect } from 'react';
import api from '../config/api';
import '../styles/Resources.css';

const Resources = () => {
  const [quote, setQuote] = useState({ quote: '', author: '' });
  const [loadingQuote, setLoadingQuote] = useState(false);

  useEffect(() => {
    fetchQuote();
  }, []);

  const fetchQuote = async () => {
    setLoadingQuote(true);
    try {
      const response = await api.get('/quote');
      setQuote(response.data);
    } catch (error) {
      console.error('Error fetching quote:', error);
      setQuote({
        quote: "Peace comes from within. Do not seek it without.",
        author: "Buddha"
      });
    } finally {
      setLoadingQuote(false);
    }
  };

  const resources = [
    {
      category: "Breathing Techniques",
      items: [
        {
          title: "Box Breathing",
          description: "A powerful stress-relief technique used by Navy SEALs. Breathe in for 4, hold for 4, exhale for 4, hold for 4.",
          icon: "üì¶"
        },
        {
          title: "4-7-8 Breathing",
          description: "Dr. Andrew Weil's relaxation technique. Breathe in for 4, hold for 7, exhale for 8.",
          icon: "üåô"
        },
        {
          title: "Diaphragmatic Breathing",
          description: "Deep belly breathing that activates the parasympathetic nervous system.",
          icon: "ü´Å"
        }
      ]
    },
    {
      category: "Mental Health Resources",
      items: [
        {
          title: "National Suicide Prevention Lifeline",
          description: "24/7 free and confidential support: 988",
          icon: "üìû",
          link: "https://988lifeline.org/"
        },
        {
          title: "Crisis Text Line",
          description: "Text HOME to 741741 for 24/7 crisis support",
          icon: "üí¨",
          link: "https://www.crisistextline.org/"
        },
        {
          title: "SAMHSA Helpline",
          description: "Substance abuse and mental health services: 1-800-662-4357",
          icon: "üè•",
          link: "https://www.samhsa.gov/find-help/national-helpline"
        }
      ]
    },
    {
      category: "Recommended Apps",
      items: [
        {
          title: "Headspace",
          description: "Guided meditation and mindfulness exercises",
          icon: "üéß",
          link: "https://www.headspace.com/"
        },
        {
          title: "Calm",
          description: "Sleep stories, meditation, and breathing exercises",
          icon: "üåä",
          link: "https://www.calm.com/"
        },
        {
          title: "Insight Timer",
          description: "Free meditation app with thousands of guided sessions",
          icon: "‚è∞",
          link: "https://insighttimer.com/"
        }
      ]
    },
    {
      category: "Articles & Guides",
      items: [
        {
          title: "The Science of Breathing",
          description: "Learn how controlled breathing affects your nervous system",
          icon: "üî¨"
        },
        {
          title: "Mindfulness for Beginners",
          description: "A comprehensive guide to starting your mindfulness practice",
          icon: "üìö"
        },
        {
          title: "Stress Management Techniques",
          description: "Evidence-based strategies for managing daily stress",
          icon: "üß†"
        }
      ]
    }
  ];

  return (
    <div className="resources-container">
      <div className="resources-header">
        <h1>Resources</h1>
        <p>Tools and information for your wellness journey</p>
      </div>

      {/* Daily Quote */}
      <div className="quote-section">
        <div className="quote-card">
          {loadingQuote ? (
            <p className="loading-quote">Loading inspiration...</p>
          ) : (
            <>
              <p className="quote-text">"{quote.quote}"</p>
              <p className="quote-author">‚Äî {quote.author}</p>
            </>
          )}
          <button className="btn-refresh" onClick={fetchQuote} disabled={loadingQuote}>
            üîÑ New Quote
          </button>
        </div>
      </div>

      {/* Resources Grid */}
      {resources.map((section, idx) => (
        <div key={idx} className="resource-section">
          <h2 className="section-title">{section.category}</h2>
          <div className="resource-grid">
            {section.items.map((item, itemIdx) => (
              <div key={itemIdx} className="resource-card">
                <div className="resource-icon">{item.icon}</div>
                <h3>{item.title}</h3>
                <p>{item.description}</p>
                {item.link && (
                  <a 
                    href={item.link} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="resource-link"
                  >
                    Learn More ‚Üí
                  </a>
                )}
              </div>
            ))}
          </div>
        </div>
      ))}

      {/* Emergency Notice */}
      <div className="emergency-notice">
        <h3>‚ö†Ô∏è In Case of Emergency</h3>
        <p>
          If you're experiencing a mental health crisis, please reach out for help immediately:
        </p>
        <ul>
          <li>Call 988 (Suicide & Crisis Lifeline)</li>
          <li>Text HOME to 741741 (Crisis Text Line)</li>
          <li>Call 911 or go to your nearest emergency room</li>
        </ul>
      </div>
    </div>
  );
};

export default Resources;
